import React from 'react';
import {Navbar} from './Navbar';
import {Footer} from './Footer';

export function Layout({ children }) {
    return (
        <div className="layout">
            <Navbar />
            <main>{children}</main>
            <Footer />
        </div>
    );
}

export default Layout;
